INSERT INTO `clause_body` (`id`, `content`, `information_type_id`, `operative_phrase_id`, `public_comment`, `parent_clause_body_id`, `root_clause_body_id`, `status`, `created_at`, `updated_at`, `author_id`) VALUES
(1, '1. The States Parties to the present Covenant recognize the right of everyone to the enjoyment of the highest attainable standard of physical and mental health', 1, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(2, '2. The steps to be taken by the States Parties to the present Covenant to achieve the full realization of this right shall include those necessary for: (c) The prevention, treatment and control of epidemic, endemic, occupational and other diseases.', 1, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(3, '1. URGES Member States : to reaffirm their commitment to increasing access to medicines, and to translate such commitment into specific regulation within countries, especially enactment of national drug policies and establishment of lists of essential medicines based on evidence and with reference to WHO''s Model List, and into actions designed to promote policy for, access to, and quality and rational use of, medicines within national health systems;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(4, '2. URGES Member States : to establish the necessary mechanisms for essential medicines lists that are science-based, independent of external pressures, and subject to regular reviews;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(5, '3. URGES Member States : in addition to health policies and actions, to implement complementary measures to ensure that national lists of essential medicines are supported by standard clinical guidelines, preferably national therapeutic formularies, with the aim of promoting rational prescription;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(6, '4. URGES Member States : to reaffirm, within the national drug policies, WHO’s concept of essential medicines as those medicines that satisfy the priority health care needs of the population, reflecting also availability, quality, price and feasibility of delivery, and reemphasizing the evidence base for overall national discussions;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:44', '2010-05-20 12:23:44', 2),
(7, '5. URGES Member States : to continue monitoring the implications on access to medicines of recent patent-protection laws and compliance with WTO’s Agreement on Trade-Related Aspects of Intellectual Property Rights (TRIPS);', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(8, '1. Requests the Director-General: to strengthen the Expert Committee on the Use of Essential Drugs, ensuring its independence from external pressures at all times, the use of science-based criteria for revision and updating, and receipt, when appropriate and as required, of the necessary inputs from all relevant stakeholders;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(9, '2. Requests the Director-General: to ensure that WHO’s medicines strategy addresses the important issue of the impact of international trade agreements on access to medicines and to reflect, in the relevant reports to WHO’s governing bodies, progress in its comprehensive endeavour;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(10, '3. Requests the Director-General: to advocate the necessary action worldwide to promote market-based differential pricing for essential medicines between high-, middle-, and low-income countries, and to provide technical support, especially to developing countries, to establish drug-pricing policies;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(11, '4.Requests the Director-General: to advocate the concept and policies of essential medicines as a tool for implementing rational prescription of medicines;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(12, '5. Requests the Director-General: to continue to work on the methodology for computerized databases on reference prices of essential medicines worldwide;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(13, '6. Requests the Director-General: to pursue all diplomatic and political opportunities aimed at overcoming barriers to access to essential medicines, collaborating with Member States in order to make these medicines accessible and affordable to the people who need them;', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(14, '7. Requests the Director-General: to join with and support nongovernmental organizations in the process of implementing initiatives that are compatible with public health priorities.', 2, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:45', '2010-05-20 12:23:45', 2),
(15, '1. URGES Member States: to apply to their specific contexts the evidenced-based policies, strategies and tools recommended by WHO, and performance-based monitoring and evaluation in order to expand coverage with major preventive interventions in populations at risk and curative interventions for patients suffering from malaria and to assess programme performance and the coverage and impact of interventions in an effective and timely manner, particularly with use of the WHO country-profile database;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(16, '2. URGES Member States: to assign national and international resources, both human and financial, for the provision of technical support in order to ensure that the most locally and epidemiologically appropriate strategies are effectively implemented and target populations are reached;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(17, '3. URGES Member States: to cease progressively the provision in both the public and private sectors of oral artemisinin monotherapies, to promote the use of artemisinin-combination therapies, and to implement policies that prohibit the production, marketing, distribution and the use of counterfeit antimalarial medicines;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(18, '4. URGES Member States: to intensify access to affordable, safe and effective antimalarial combination treatments, to intermittent preventive treatment in pregnancies, with special precautions for HIV-infected pregnant women who are receiving co-trimoxazole chemotherapy, to insecticide-treated mosquito nets, including through the free distribution of such nets where appropriate, and indoor residual spraying for malaria control with suitable and safe insecticides, taking into account relevant international rules, standards and guidelines;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(19, '5. URGES Member States: to provide, whenever necessary, in their legislation for use, to the full, of the flexibilities contained in the Agreement on Trade-Related Aspects of Intellectual Property Rights in order to promote access to pharmaceutical products', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(20, '6. URGES Member States: to use all necessary administrative and legislative means, including, where appropriate, the use of provisions in international agreements, including the Agreement on Trade-Related Aspects of Intellectual Property Rights in order to promote access to preventive technologies against malaria;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(21, '7. URGES Member States: to aim at reducing or interrupting malaria transmission, wherever feasible, through integrated vector management, promoting improvement of local and environmental conditions and healthy settings, and increasing access to basic health services, antimalarial medicines, diagnostics and preventive technologies in order to reduce the disease burden;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(22, '8- URGES Member States: to implement integrated approaches to malaria prevention and  control through multisectoral collaboration and community responsibility and participation;', 1, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(23, '1. Requests international organizations and financing bodies to provide support for the development of capacities in developing countries in order to expand use of reliable diagnostics, artemisinin-based combination therapies that are appropriate for local drug-resistance conditions, integrated vector management including long-lasting insecticide-treated nets and larvicidal measures, indoor residual spraying with appropriate and \nsafe insecticides as indicated by WHO and in accordance with the Stockholm Convention on Persistent Organic Pollutants, and monitoring and evaluation systems, including use of the country database developed by WHO;', 3, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:46', '2010-05-20 12:23:46', 2),
(24, '2. Requests international organizations and financing bodies to increase funding for malaria control, so that the relevant agencies can continue \nproviding support to countries, and to channel additional resources into technical support so that the financial resources can be absorbed and used effectively in countries', 3, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(25, '3. Requests international organizations and financing bodies to provide support for elimination of malaria in areas where it is feasible and sustainable', 3, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(26, '4. Requests international organizations and financing bodies to adjust their policies so as progressively to cease to fund the provision and distribution \nof oral artemisinin monotherapies, and to join in campaigns to prohibit the production, marketing, distribution and use of counterfeit antimalarial medicines', 3, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(27, '1. Requests the Director-General to take steps to identify gaps in knowledge about malaria control and elimination; to provide support for the development of new tools for diagnosis, therapy, prevention and control, and of strategies; to estimate more accurately the global burden of disease and determine trends; to develop new tools and methods for assessing impact and cost-effectiveness of interventions; to build up WHO’s current research on malaria, including that of the UNICEF/UNDP/World Bank/WHO Special Programme for Research and Training in Tropical Diseases; to provide technical support to countries for conducting operational and implementation research; and to mobilize resources and increase support for research in the development of new tools and strategies for prevention and control of malaria', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(28, '2. Requests the Director-General to strengthen and rationalize human resources for malaria by deploying staff to country level, thus improving the capacity of WHO’s country offices to provide technical guidance to national health programmes', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(29, '3. Requests the Director-General to provide support to coordinating partners and countries for malaria control in refugee camps and in complex emergencies', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(30, '4. Requests the Director-General to improve the coordination between different stakeholders in the fight against malaria', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(31, '5. Requests the Director-General to support the sound management of DDT use for vector control in accordance with the Stockholm Convention on Persistent Organic Pollutants, and to share data on such use with \nMember States', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(32, '6. Requests the Director-General to report to the Health Assembly biennially through the Executive Board on progress made in implementation of this resolution', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(33, '1. Resolves that World Malaria Day shall be commemorated annually on 25 April, or on such other day or days as individual Member States may decide, in order to provide education and understanding of malaria as a global scourge that is preventable and a disease that is curable', 4, 4, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(34, '2. Resolves that World Malaria Day shall be the culmination of year-long intensified implementation of national malaria-control strategies, including community-based activities for malaria prevention and treatment in endemic areas, and the occasion to inform the general public of the obstacles encountered and progress achieved in controlling malaria', 4, 4, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:47', '2010-05-20 12:23:47', 2),
(35, 'REDEDICATE OURSELVES TO: The principles and targets of the Harare Declaration of 1997', 5, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:49', '2010-05-20 12:23:49', 2),
(36, 'i. COMMIT OURSELVES TO AN INTENSIVE EFFORT TO: Halve the malaria mortality for Africa''s people by 2010, through implementing the strategies and actions for Roll Back Malaria, agreed at the summit.', 5, 5, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:49', '2010-05-20 12:23:49', 2),
(37, 'ii. COMMIT OURSELVES TO AN INTENSIVE EFFORT TO: Initiate actions at country level to provide resources to facilitate realization of RBM objectives.', 5, 5, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:49', '2010-05-20 12:23:49', 2),
(38, 'iii. COMMIT OURSELVES TO AN INTENSIVE EFFORT TO: Work with our partners in malaria-affected countries towards stated targets, ensuring the\nallocation of necessary resources from private and public sectors and from non-governmental organizations.', 5, 5, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:49', '2010-05-20 12:23:49', 2),
(39, 'iv. COMMIT OURSELVES TO AN INTENSIVE EFFORT TO: Create an enabling environment in our countries which will permit increased participation of\ninternational partners in our malaria control actions.', 5, 5, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(40, 'RESOLVE TO: Initiate appropriate and sustainable action to strengthen the health systems to ensure that by the year 2005, At least 60% of those suffering from malaria have prompt access to and are able to use correct, \naffordable and appropriate treatment within eight hours of the onset of symptoms.', 5, 4, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(41, 'RESOLVE TO: Initiate appropriate and sustainable action to strengthen the health systems to ensure that by the year 2005, At least 60% of those at risk of malaria particularly pregnant women and children under five years of age, benefit from the most suitable combination of personal and community protective measures such as insecticide treated mosquito nets and other materials to prevent infection and suffering.', 5, 6, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(42, 'RESOLVE TO: Initiate appropriate and sustainable action to strengthen the health systems to ensure that by the year 2005, At least 60% of all pregnant women who are at risk of malaria, especially those in their first pregnancies, have access to chemoprophylaxis or presumptive intermittent treatment.', 5, 6, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(43, 'CALL UPON: All member states to undertake health systems reforms which will, Promote community participation in joint ownership and control of Roll Back Malaria actions to\nenhance their sustainability.', 5, 7, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(44, 'CALL UPON: All member states to undertake health systems reforms which will, Make diagnosis and treatment of malaria available as far peripherally as possible including home treatment.', 5, 7, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(45, 'CALL UPON: All member states to undertake health systems reforms which will, Make appropriate treatment available and accessible to the poorest groups in the community.', 5, 7, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(46, 'PLEDGE TO: Take immediate actions to: Implement in our countries the approved plan of Action attached to this Declaration.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(47, 'PLEDGE TO:  Take immediate actions to:Develop mechanisms to facilitate the provision of reliable information on malaria to decisionmakers at household, community, district and national levels, to enable them take appropriate actions.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(48, 'PLEDGE TO: Take immediate actions to: Reduce or waive taxes and tariffs for mosquito nets and materials, insecticides, anti-malarial drugs and other recommended goods and services that are needed for malaria control strategies.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(49, 'PLEDGE TO: Take immediate actions to: Allocate the resources required for sustained implementation of planned Roll Back Malaria actions.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(50, 'PLEDGE TO: Take immediate actions to: Increase support for research (including operational research) to develop new tools and improve existing ones.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:50', '2010-05-20 12:23:50', 2),
(51, 'PLEDGE TO: Commemorate this summit by declaring April 25th each year as Africa Malaria Day.', 5, 8, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:51', '2010-05-20 12:23:51', 2),
(52, 'Calls upon the international community, in particular the donor countries, to expand, where possible, fund-raising channels and to provide adequate financial resources and medical and technical assistance to the affected developing countries, in particular African countries and the least developed countries, for the successful implementation of work plans and projects and the achievement of significant progress, in both the short and the medium term, in controlling malaria, and to intensify basic and applied research on anti-malarial vaccines as a priority;', 6, 9, NULL, 149, 149, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:24:39', 2),
(53, 'Requests the United Nations, and appeals to international organizations, multilateral financial institutions, the specialized agencies, organs and programmes of the United Nations system, non-governmental organizations, the private sector and other groups, to join as partners in this initiative by, inter alia, contributing technical and financial support', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:23:52', 2),
(54, 'Urges international development partners, in collaboration with private industry, to intensify their efforts to develop and widely distribute vaccines and other remedies against malaria and diarrhoeal diseases, including cholera;', 3, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:23:52', 2),
(55, 'Urges the Director-General of the World Health Organization to continue to provide, in collaboration with the United Nations Children''s Fund and other concerned United Nations agencies and programmes and other relevant international organizations such as the International Centre for Diarrhoeal Diseases Research and the International Vaccine Institute, technical expertise and support to endemic countries;', 2, 2, NULL, 151, 151, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:24:39', 2),
(56, 'Stresses the importance of adopting and implementing national plans of action in countries where malaria is endemic in conformity with the Global Strategy for Malaria Control of the World Health Organization;', 4, 1, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:23:52', 2),
(57, 'Requests the Secretary-General to submit a progress report to the Economic and Social Council at its substantive session of 2001 on the implementation of the present resolution, to be prepared by the Director-General of the World Health Organization in collaboration with other relevant organizations, organs, bodies and programmes of the United Nations system.', 2, 3, NULL, 152, 152, 'draft', '2010-05-20 12:23:52', '2010-05-20 12:24:39', 2),
(58, 'Calls attention to the seriousness of the tsetse and trypanosomiasis problem and its increasing significance as a contstraint to sustainable development in Africa and the alleviation of rural poverty;', 4, 10, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:53', '2010-05-20 12:23:53', 2),
(59, 'Takes note of the decision of the Assembly of Heads of State and Government of the Organization of African Unity to free Africa of tsetse flies,', 4, 11, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:54', '2010-05-20 12:23:54', 2),
(60, 'Welcomes the Organization of African Unity plan of action for a camppaign to achieve the goal of the Pan-Africa Tsetse and Trypanosomiasis Eradication Campaign Initiative', 1, 12, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:54', '2010-05-20 12:23:54', 2),
(61, 'Calls upon all Member States, organizations of the United Nations system and the international community to support fully this initiative', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:54', '2010-05-20 12:23:54', 2),
(62, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability in sufficient quantities of pharmaceuticals and medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:55', '2010-05-20 12:23:55', 2),
(63, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (b) The accessibility to all without discrimination, including the most vulnerable sectors of the population, of such pharmaceuticals or medical technologies and their affordability for all, including socially disadvantaged groups;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:55', '2010-05-20 12:23:55', 2),
(64, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (c) The assurance that pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:55', '2010-05-20 12:23:55', 2),
(65, 'Also calls upon States, at the national level, on a non-discriminatory basis: (a) To refrain from taking measures which would deny or limit equal access for all persons to preventive, curative or palliative pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(66, 'Also calls upon States, at the national level, on a non-discriminatory basis: (b) To adopt legislation or other measures, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceuticals or medical technologies from any limitations by third parties;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(67, 'Also calls upon States, at the national level, on a non-discriminatory basis: (c) To adopt all appropriate positive measures to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceuticals or medical technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(68, 'Further calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (a) To facilitate, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them, as well as to \nextend the necessary cooperation, wherever possible, especially in times of emergency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(69, 'Further calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (b) To ensure that their actions as members of international organizations take due account of the right of everyone to the enjoyment of the highest attainable standard of physical and mental health and that the application of international agreements is supportive of public health policies which promote broad access to safe, effective and affordable preventive, curative or palliative pharmaceuticals and medical technologies;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(70, 'Calls upon the international community, the developed countries in particular, to continue to assist the developing countries in their fight against pandemics such as HIV/AIDS through financial and technical support as well as training of personnel;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(71, 'Invites the Committee on Economic, Social and Cultural Rights, when \nconsidering the human rights dimension of combating pandemics such as HIV/AIDS, to give attention to the issue of access to medication', 2, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(72, 'invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(73, 'Requests the Secretary-General to solicit comments from Governments, \nUnited Nations organs, programmes and specialized agencies and international and non-governmental organizations on the steps they have taken to promote and implement, where applicable, the present resolution, as well as to report thereon to the Commission at its fifty-eighth session', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:23:56', 2),
(74, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability in sufficient quantities of pharmaceuticals and medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them;  (b) The accessibility to all without discrimination, including the most vulnerable sectors of the population, of such pharmaceuticals or medical technologies and their affordability for all, including socially disadvantaged groups; (c) The assurance that pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, 64, 62, 'draft', '2010-05-20 12:23:56', '2010-05-20 12:24:39', 2),
(75, 'Also calls upon States, at the national level, on a non-discriminatory basis: (a) To refrain from taking measures which would deny or limit equal access for all persons to preventive, curative or palliative pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them; (b) To adopt legislation or other measures, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceuticals or medical technologies from any limitations by third parties;  (c) To adopt all appropriate positive measures to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceuticals or medical technologies;', 5, 9, NULL, 67, 65, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:24:39', 2),
(76, 'Further calls upon States, in furtherance of the Declaration of Commitment on HIV/AIDS, to address factors affecting the provision of drugs related to the treatment of pandemics such as HIV/AIDS and the most common opportunistic infections that accompany them, as well as to develop integrated strategies to strengthen health care systems, including laboratory capacities and the training of health-care providers and technicians, in order to provide treatment and monitor the use of medications, diagnostics and related technologies', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:23:57', 2),
(77, 'Calls upon States to take all appropriate measures, nationally and through cooperation, to promote the development of new and more effective preventive, curative or palliative pharmaceuticals, in accordance with applicable international law, including international agreements acceded to;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:23:57', 2),
(78, 'Also calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (a)To facilitate, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceuticals or medical technologies used to treat pandemics such as HIV/AIDS or the most common opportunistic infections that accompany them, as well as to extend the necessary cooperation, wherever possible, especially in times of emergency; (b) To ensure that their actions as members of international organizations take due account of the right of everyone to the enjoyment of the highest attainable standard of physical and mental health and that the application of international agreements is supportive of public health policies which promote broad access to safe, effective and affordable preventive, curative or palliative pharmaceuticals and medical technologies;', 6, 9, NULL, 69, 68, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:24:39', 2),
(79, 'Calls upon the international community, the developed countries in particular, to continue to assist the developing countries in their fight against pandemics such as HIV/AIDS through financial and technical support, as well as through the training of personnel', 6, 9, NULL, 70, 70, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:24:39', 2),
(80, 'Invites the Committee on Economic, Social and Cultural Rights, when considering the human rights dimension of combating pandemics such as HIV/AIDS, to give attention to the issue of access to medication and invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, 72, 71, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:24:39', 2),
(81, 'Requests the Secretary-General to solicit comments from Governments, United Nations organs, programmes and specialized agencies and international and non-governmental organizations on the steps they have taken to promote and implement, where applicable, the present resolution, as well as to report thereon to the Commission at its fifty-ninth session;', 2, 3, NULL, 73, 73, 'draft', '2010-05-20 12:23:57', '2010-05-20 12:24:40', 2),
(82, 'Calls upon States to develop and implement national strategies, in accordance with applicable international law, including international agreements acceded to, in order progressively to realize access for all to prevention-related goods, services and information as well as access to comprehensive treatment, care and support for all individuals infected and affected by pandemics such as HIV/AIDS, tuberculosis and malaria', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:00', '2010-05-20 12:24:00', 2),
(83, 'Also calls upon States to establish or strengthen national health and social infrastructures and health-care systems, with the assistance of the international community as necessary, for the effective delivery of prevention, treatment, care and support to respond to pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:01', 2),
(84, 'Further calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability in sufficient quantities of pharmaceutical products and medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them; (b) The accessibility and affordability for all without discrimination, including the most vulnerable or socially disadvantaged groups of the population, of pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them;  (c) The assurance that pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, 74, 62, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:40', 2),
(85, 'Calls upon States, at the national level, on a non-discriminatory basis, in accordance with applicable international law, including international agreements acceded to: (a) To refrain from taking measures which would deny or limit equal access for all persons to preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them; (b) To adopt and implement legislation or other measures, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceutical products or medical technologies from any limitations by third parties;  (c) To adopt all appropriate positive measures, to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceutical products or medical technologies;', 5, 9, NULL, 75, 65, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:40', 2),
(86, 'Also calls upon States, in furtherance of the Declaration of Commitment on HIV/AIDS, to address factors affecting the provision of drugs related to the treatment of pandemics such as HIV/AIDS and the most common opportunistic infections that accompany them, as well as to develop integrated strategies to strengthen health-care systems, including voluntary counselling and testing, laboratory capacities and the training of health-care providers and technicians, in order to provide treatment and monitor the use of medications, diagnostics and related technologies;', 5, 9, NULL, 76, 76, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:40', 2),
(87, 'Further calls upon States to take all appropriate measures, nationally and through cooperation, to promote research and development of new and more effective preventive, curative or palliative pharmaceutical products and diagnostic tools, in accordance with applicable international law, including international agreements acceded to;', 5, 9, NULL, 77, 77, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:40', 2),
(88, 'Calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (a) To facilitate, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them, as well as to extend the necessary cooperation, wherever possible, especially in times of emergency;  (b) To ensure that their actions as members of international organizations take due account of the right of everyone to the enjoyment of the highest attainable standard of physical and mental health and that the application of international agreements is supportive of public health policies which promote broad access to safe, effective and affordable preventive, curative or palliative pharmaceutical products and medical technologies;', 6, 9, NULL, 78, 68, 'draft', '2010-05-20 12:24:01', '2010-05-20 12:24:40', 2),
(89, 'Welcomes the financial contributions made to date to the Global Fund to Fight AIDS, Tuberculosis and Malaria, urges that further contributions be made to sustain the Fund and also calls upon all States to encourage the private sector to contribute to the Fund as a matter of urgency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:02', 2),
(90, 'Calls upon the Joint United Nations Programme on HIV/AIDS to mobilize further resources to combat the HIV/AIDS pandemic  and upon all Governments to take measures to ensure that the necessary resources are made available to the Joint United Nations Programme on HIV/AIDS, in line with the Declaration of Commitment on HIV/AIDS;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:02', 2),
(91, 'Also calls upon States to ensure that those at risk of contracting malaria, in particular pregnant women and children under 5 years of age, benefit from the most suitable combination of personal and community protective measures, such as insecticide treated bed nets and other interventions that are accessible and affordable, to prevent infection and suffering;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:02', 2),
(92, 'Further calls upon States to provide the necessary support for the World Health Organization Roll Back Malaria and Stop TB partnerships in ongoing measures to combat malaria and tuberculosis;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:02', 2),
(93, 'Calls upon the international community, the developed countries in particular, to continue to assist the developing countries in the fight against pandemics such as HIV/AIDS, tuberculosis and malaria through financial and technical support, as well as through the training of personnel;', 6, 9, NULL, 79, 70, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:40', 2),
(94, 'Invites the Committee on Economic, Social and Cultural Rights also to give attention to the issue of access to medication in the context of pandemics such as HIV/AIDS, tuberculosis and malaria and invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, 80, 71, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:40', 2),
(95, 'Requests the Secretary-General to solicit comments from Governments, United Nations organs, programmes and specialized agencies and international and non-governmental organizations on the steps they have taken to promote and implement, where applicable, the present resolution, as well as to report thereon to the Commission at its sixtieth session;', 2, 3, NULL, 81, 73, 'draft', '2010-05-20 12:24:02', '2010-05-20 12:24:40', 2),
(96, 'Calls upon States to consider taking into account the guidelines elaborated at the Second International Consultation on HIV/AIDS and Human Rights held in Geneva from 23 to 25 September 1996 (E/CN.4/1997/37, annex I), as well as the revision of guideline 6 at the Third International Consultation, held on 25 and 26 July 2002;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(97, 'Also calls upon States to develop and implement national strategies, in accordance with applicable international law, including international agreements acceded to, in order progressively to realize access for all to prevention related goods, services and information as well as access to comprehensive treatment, care and support for all individuals infected and affected by pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(98, 'Further calls upon States to establish or strengthen national health and social infrastructures and health care systems, with the assistance of the international community as necessary, for the effective delivery of prevention, treatment, care and support to respond to pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(99, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability, in sufficient quantities, of pharmaceutical products and medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them; (b) The accessibility and affordability for all without discrimination, including the most vulnerable or socially disadvantaged groups of the population, of pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them;   (c) The assurance that pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(100, 'Calls upon States, at the national level, on a non discriminatory basis, in accordance with applicable international law, including international agreements acceded to: (a) To refrain from taking measures which would deny or limit equal access for all persons to preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them;  (b) To adopt and implement legislation or other measures, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceutical products or medical technologies from any limitations by third parties;  (c) To adopt all appropriate positive measures, to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceutical products or medical technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(101, 'Also calls upon States, in furtherance of the Declaration of Commitment on HIV/AIDS, to address factors affecting the provision of drugs related to the treatment of pandemics such as HIV/AIDS and the most common opportunistic infections that accompany them, as well as to develop integrated strategies to strengthen health care systems, including voluntary counselling and testing, laboratory capacities and the training of health care providers and technicians, in order to provide treatment and monitor the use of medications, diagnostics and related technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:03', '2010-05-20 12:24:03', 2),
(102, 'Further calls upon States to take all appropriate measures, nationally and through cooperation, to promote research and development of new and more effective preventive, curative or palliative pharmaceutical products and diagnostic tools, in accordance with applicable international law, including international agreements acceded to;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(103, 'Calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as:\n (a) To facilitate, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them, as well as to extend the necessary cooperation, wherever possible, especially in times of emergency;(b) To ensure that their actions as members of international organizations take due account of the right of everyone to the enjoyment of the highest attainable standard of physical and mental health and that the application of international agreements is supportive of public health policies that promote broad access to safe, effective and affordable preventive, curative or palliative pharmaceutical products and medical technologies;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(104, 'Urges States to consider, whenever necessary, adapting national legislation in order to use to the full the flexibilities contained in the TRIPS Agreement;', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(105, 'Welcomes the financial contributions made to date to the Global Fund to Fight AIDS, Tuberculosis and Malaria, urges that further contributions be made by States and other donors, and also calls upon all States to encourage the private sector to contribute to the Fund as a matter of urgency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(106, 'Calls upon all States and other donors to cooperate in supporting the “3 by 5” Initiative launched jointly by the World Health Organization and UNAIDS with the aim of providing antiretroviral therapy to 3 million people in the developing world by 2005;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(107, 'Calls upon UNAIDS to mobilize further resources to combat the HIV/AIDS pandemic  upon all Governments to take measures to ensure that the necessary resources are made available to UNAIDS, in line with the Declaration of Commitment on HIV/AIDS;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(108, 'Calls upon States to ensure that those at risk of contracting malaria, in particular pregnant women and children under five years of age, benefit from the most suitable combination of personal and community protective measures, such as insecticide treated bed nets and other interventions that are accessible and affordable, to prevent infection and suffering;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(109, 'Also calls upon States to provide the necessary support for the World Health Organization “Roll Back Malaria” and “Stop TB” partnerships in ongoing measures to combat malaria and tuberculosis;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(110, 'Calls upon the international community, the developed countries in particular, to continue to assist the developing countries in the fight against pandemics such as HIV/AIDS, tuberculosis and malaria through financial and technical support, as well as through the training of personnel;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(111, 'Invites the Committee on Economic, Social and Cultural Rights also to give attention to the issue of access to medication in the context of pandemics such as HIV/AIDS, tuberculosis and malaria  invites States to include appropriate information thereon in the reports they submit to the Committee; and invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2),
(112, 'Requests the Secretary General to solicit comments from Governments, United Nations organs, programmes and specialized agencies and international and non governmental organizations on the steps they have taken to promote and implement, where applicable, the present resolution, as well as to report thereon to the Commission at its sixty first session;', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:04', '2010-05-20 12:24:04', 2);
INSERT INTO `clause_body` (`id`, `content`, `information_type_id`, `operative_phrase_id`, `public_comment`, `parent_clause_body_id`, `root_clause_body_id`, `status`, `created_at`, `updated_at`, `author_id`) VALUES
(113, 'Calls upon States to consider taking into account the guidelines elaborated at the Second International Consultation on HIV/AIDS and Human Rights held in Geneva from 23 to 25 September 1996 (E/CN.4/1997/37, annex I), as well as the revision of guideline 6 at the Third International Consultation, held on 25 and 26 July 2002;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:05', '2010-05-20 12:24:05', 2),
(114, 'Also calls upon States to develop and implement national strategies, in accordance with applicable international law, including international agreements acceded to, in order to progressively realize access for all to prevention related goods, services and information as well as access to comprehensive treatment, care and support for all individuals infected and affected by pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:05', '2010-05-20 12:24:05', 2),
(115, 'Further calls upon States to establish or strengthen national health and social infrastructures and health care systems, with the assistance of the international community as necessary, for the effective delivery of prevention, treatment, care and support to respond to pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:05', '2010-05-20 12:24:05', 2),
(116, 'Calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability, in sufficient quantities, of pharmaceutical products and medical technologies used to treat and/or prevent pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them; (b) The accessibility and affordability for all without discrimination, including the most vulnerable or socially disadvantaged groups of the population, as well as infants and children, of pharmaceutical products or medical technologies used to treat and/or prevent pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them; (c) The assurance that pharmaceutical products or medical technologies used to treat and/or prevent pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(117, 'Calls upon States, at the national level, on a non discriminatory basis, in accordance with applicable international law, including international agreements acceded to: (a) To refrain from taking measures which would deny or limit equal access for all persons to preventive, curative or palliative pharmaceutical products or medical technologies, including microbicides and male and female condoms, used to treat and/or prevent pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them;  (b) To adopt and implement, as appropriate, legislation or other measures affecting public health, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceutical products or medical technologies from any limitations by third parties; (c) To adopt all appropriate positive measures, to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceutical products or medical technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(118, 'Also calls upon States, in furtherance of the Declaration of Commitment on HIV/AIDS, to address factors affecting the provision of drugs related to the treatment of pandemics such as HIV/AIDS and the most common opportunistic infections that accompany them, as well as to develop integrated strategies to strengthen health care systems;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(119, 'Urges States to develop and implement national health policies that monitor the use of medications, diagnoses and related technologies, to ensure informed consent and confidentiality in conducting HIV testing and counselling, and to strengthen laboratory capacities and the training of health-care providers and technicians;', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(120, 'Calls upon States to adopt effective measures to prevent mother-to-child transmission of HIV and to facilitate access to antiretroviral therapy, safe delivery practices and breast-milk substitutes, where feasible and safe;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(121, 'Also calls upon States to take all appropriate measures, nationally and through cooperation, to promote research and development of new and more effective preventive, curative or palliative pharmaceutical products and diagnostic tools, in accordance with applicable international law, including international agreements acceded to;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(122, 'Further calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (a) To facilitate, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceutical products or medical technologies used to treat and/or prevent pandemics such as HIV/AIDS, tuberculosis and malaria and the most common opportunistic infections that accompany them, as well as to extend the necessary cooperation, wherever possible, especially in times of emergency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(123, 'Urges States to consider, whenever necessary, enacting appropriate national legislation in order to use to the fullest extent the flexibilities contained in the TRIPS Agreement encourages States to take into account such flexibilities when entering into international trade agreements that may affect public health;', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(124, 'Calls upon States to conduct an impact assessment of the effects of international trade agreements with regard to public health and to the progressive realization of the right of everyone to the highest attainable standard of health;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(125, 'Welcomes the financial contributions made to date to the Global Fund to Fight AIDS, Tuberculosis and Malaria, urges that further contributions be made by States and other donors, and also calls upon all States to encourage the private sector to increase their contributions to the Fund as a matter of urgency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(126, 'Calls upon all States and other donors to cooperate in supporting the “3 by 5” Initiative launched jointly by the World Health Organization and UNAIDS with the aim of providing antiretroviral treatment to 3 million people in the developing world by the end of 2005;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(127, 'Calls upon international organizations, agencies and programmes to mobilize further resources to combat pandemics such as HIV/AIDS, tuberculosis and malaria and calls upon all Governments to take measures to ensure that the necessary resources are made available for that purpose;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(128, 'Calls upon States to ensure that those at risk of contracting malaria, in particular pregnant women and children under five years of age, benefit from the most suitable combination of personal and community protective measures, such as insecticide treated bed nets, indoor residual spraying and other interventions that are accessible and affordable, in order to prevent infection and suffering, and to support expanded access to artemisinin-based combination therapy;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:06', '2010-05-20 12:24:06', 2),
(129, 'Also calls upon States to provide the necessary support for the World Health Organization “Roll Back Malaria” and “Stop TB” partnerships in ongoing measures to combat malaria and tuberculosis;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:07', '2010-05-20 12:24:07', 2),
(130, 'Calls upon the international community, the developed countries in particular, to continue to assist the developing countries in the fight against pandemics such as HIV/AIDS, tuberculosis and malaria through financial and technical support, as well as through the training of personnel;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:07', '2010-05-20 12:24:07', 2),
(131, 'Invites the Committee on Economic, Social and Cultural Rights also to give attention to the issue of access to medication in the context of pandemics such as HIV/AIDS, tuberculosis and malaria and invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:07', '2010-05-20 12:24:07', 2),
(132, 'Requests the Secretary General to solicit comments from Governments, United Nations organs, programmes and specialized agencies and international and non governmental organizations on the steps they have taken to promote and implement, where applicable, the present resolution, as well as to report thereon to the Commission at its sixty second session;', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:07', '2010-05-20 12:24:07', 2),
(133, 'Calls upon States to develop and implement national strategies, in accordance with applicable international law, including international agreements acceded to, in order progressively to realize access for all to prevention-related goods, services and information as well as access to comprehensive treatment, care and support for all individuals infected and affected by pandemics such as HIV/AIDS, tuberculosis and malaria', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(134, 'Also calls upon States to establish or strengthen national health and social infrastructures and health-care systems, with the assistance of the international community as necessary, for the effective delivery of prevention, treatment, care and support to respond to pandemics such as HIV/AIDS, tuberculosis and malaria;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(135, 'Further calls upon States to pursue policies, in accordance with applicable international law, including international agreements acceded to, which would promote: (a) The availability in sufficient quantities of pharmaceutical products and medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them;  (b) The accessibility and affordability for all without discrimination, including the most vulnerable or socially disadvantaged groups of the population, of pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them; (c) The assurance that pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them, irrespective of their sources and countries of origin, are scientifically and medically appropriate and of good quality;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(136, 'Calls upon States, at the national level, on a non-discriminatory basis, in accordance with applicable international law, including international agreements acceded to: (a) To refrain from taking measures that would deny or limit equal access for all persons to preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis, malaria or the most common opportunistic infections that accompany them;  (b) To adopt and implement legislation or other measures, in accordance with applicable international law, including international agreements acceded to, to safeguard access to such preventive, curative or palliative pharmaceutical products or medical technologies from any limitations by third parties; (c) To adopt all appropriate positive measures, to the maximum of the resources allocated for this purpose, to promote effective access to such preventive, curative or palliative pharmaceutical products or medical technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(137, 'Also calls upon States, in furtherance of the Declaration of Commitment on HIV/AIDS, to address factors affecting the provision of drugs related to the treatment of pandemics such as HIV/AIDS and the most common opportunistic infections that accompany them, as well as to develop integrated strategies to strengthen health-care systems, including voluntary counselling and testing, laboratory capacities and the training of health-care providers and technicians, in order to provide treatment and monitor the use of medications, diagnostics and related technologies;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(138, 'Further calls upon States to take all appropriate measures, nationally and through cooperation, to promote the research and development of new and more effective preventive, curative or palliative pharmaceutical products and diagnostic tools, in accordance with applicable international law, including international agreements acceded to;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(139, 'Calls upon States, at the international level, to take steps, individually and/or through international cooperation, in accordance with applicable international law, including international agreements acceded to, such as: (a) Facilitating, wherever possible, access in other countries to essential preventive, curative or palliative pharmaceutical products or medical technologies used to treat pandemics such as HIV/AIDS, tuberculosis and malaria or the most common opportunistic infections that accompany them, as well as extending the necessary cooperation, wherever possible, especially in times of emergency; (b) Ensuring that their actions as members of international organizations, take due account of the right of everyone to the enjoyment of the highest attainable standard of physical and mental health and that the application of international agreements is supportive of public health policies that promote broad access to safe, effective and affordable preventive, curative or palliative pharmaceutical products and medical technologies;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(140, 'Welcomes the financial contributions made to date to the Global Fund to Fight AIDS, Tuberculosis and Malaria, urges that further contributions be made to sustain the Fund and calls upon all States to encourage the private sector to contribute to the Fund as a matter of urgency;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(141, 'Calls upon the Joint United Nations Programme on HIV/AIDS to mobilize further resources to combat the HIV/AIDS pandemic  and  upon all Governments to take measures to ensure that the necessary resources are made available to the Joint United Nations Programme on HIV/AIDS, in line with the Declaration of Commitment on HIV/AIDS;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(142, 'Calls upon States to ensure that those at risk of contracting malaria, in particular pregnant women and children under five years of age, benefit from the most suitable combination of personal and community protective measures, such as insecticide treated bed nets and other interventions that are accessible and affordable, to prevent infection and suffering;', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:08', '2010-05-20 12:24:08', 2),
(143, 'Also calls upon States to provide the necessary support for the World Health Organization Roll Back Malaria and Stop Tuberculosis partnerships in ongoing measures to combat malaria and tuberculosis;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(144, 'Calls upon the international community, in particular the developed countries, to continue to assist the developing countries in the fight against pandemics such as HIV/AIDS, tuberculosis and malaria through financial and technical support, as well as through the training of personnel;', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(145, 'Invites the Committee on Economic, Social and Cultural Rights also to give attention to the issue of access to medication in the context of pandemics such as HIV/AIDS, tuberculosis and malaria and invites States to include appropriate information thereon in the reports they submit to the Committee;', 7, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(146, 'Decides to retain the topic of malaria and diarrhoeal diseases, in particular cholera, on the agenda of its substantive session of 1995, for consideration in the general segment;', 4, 14, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(147, 'Requests the Secretary-General to prepare a report on this topic that further addresses the agreed conclusions of the Council on the 1993 coordination segment, and responds specifically to the questions and concerns raised during the discussion at its substantive session of 1994; the report should be prepared with the World Health Organization and other relevant organs, organizations and bodies of the United Nations system, taking into account their expertise in the area of health and development;', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(148, 'Also requests the Secretary-General to include options in that report, given the need to increase the resources being devoted to the prevention and control of malaria and diarrhoeal diseases, in particular cholera, in developing countries, particularly in Africa, which may include a mechanism to improve coordination among agencies of the United Nations system in a manner that can enhance action on this issue and help to mobilize the national, bilateral and multilateral funds required for this purpose and improve the efficiency of existing programmes with the same aim.', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:09', '2010-05-20 12:24:09', 2),
(149, 'Stresses the urgent need to prevent and control these diseases and, to that end, calls on the international community, especially industrialized countries, to expand, where possible, fund-raising channels and to provide adequate financial resources to countries where the diseases are endemic, especially the least developed countries, for the successful implementation of the workplans and the achievement of significant impacts in both the short and medium term, while recognizing that basic and applied research, including research on vaccines, is a priority component of such workplans.', 6, 15, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:10', '2010-05-20 12:24:10', 2),
(150, 'Welcomes with satisfaction the agreement signed between Dr. Manuel Elkin Patarroyo of Colombia and the World Health Organization during the forty-eighth World Health Assembly, in May 1995, by which Dr. Patarroyo donated to the World Health Organization the licence of the patent rights and know-how related to the SPf66 anti-malarial vaccine developed by him, and stresses the importance of the World Health Organization urgently taking full advantage of this donation;', 2, 12, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:10', '2010-05-20 12:24:10', 2),
(151, 'Urges the Director-General of the World Health Organization, the lead agency in international health, to continue to provide, in collaboration with the concerned United Nations agencies and programmes and within the United Nations resident coordinator system, technical expertise and support for the agreed strategies and workplans in support of national health development plans and actions in countries where these diseases are rife;', 2, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:10', '2010-05-20 12:24:10', 2),
(152, 'Requests the Secretary-General to submit to the Economic and Social Council at its substantive session of 1998 the report of the Director-General of the World Health Organization on the implementation of the strategies and workplans presented to the Council at its substantive session of 1995, to be prepared in collaboration with the other relevant organizations, organs, bodies and programmes of the United Nations system.', 2, 3, NULL, 147, 147, 'draft', '2010-05-20 12:24:10', '2010-05-20 12:24:40', 2),
(153, 'Calls upon the international community, in particular the donor countries, to expand, where possible, fund-raising channels and to provide adequate financial resources and medical and technical assistance to the affected developing countries, in particular African countries and least developed countries, for the successful implementation of work plans and projects and the achievement of significant progress in both the short and the  medium term in controlling malaria, and to intensify basic and applied research on anti-malarial vaccines as a priority.', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:11', '2010-05-20 12:24:11', 2),
(154, 'Encourages the Director-General of the World Health Organization, \nthrough the World Health Organization’s Division of Control of Tropical \nDiseases, to continue his efforts to mobilize international organizations, \nmultilateral financial institutions, the specialized agencies, organs and \nprogrammes of the United Nations system and non-governmental organizations as well as other groups to provide the affected developing countries, in particular African countries, with technical, medical and financial resources and assistance commensurate with the needs set forth in those countries’ national plans to control malaria;', 2, 16, NULL, 158, 158, 'draft', '2010-05-20 12:24:11', '2010-05-20 12:24:40', 2),
(155, 'Requests the Secretary-General to transmit to the General  Assembly at its fifty-first session the progress report of the Director-General of the World Health Organization on the implementation of the strategies and work plans to be prepared in collaboration with the other relevant organs, organizations, bodies and programmes of the United Nations system.', 2, 9, NULL, 159, 159, 'draft', '2010-05-20 12:24:11', '2010-05-20 12:24:40', 2),
(156, 'Calls for continued support, in particular for the United Nations Development Programme/World Bank/World Health Organization special programme for research and training in tropical diseases and to the Division of Control of Tropical Diseases of the World Health Organization;', 4, 15, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:12', '2010-05-20 12:24:12', 2),
(157, 'Appeals to the international community, international organizations, multilateral financial institutions, specialized agencies, organs and programmes of the United Nations system and non-governmental organizations as well as all interested groups to provide developing countries, in particular African countries, with technical, medical and financial assistance commensurate with the efforts needed to control this endemic disease', 2, 17, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:12', '2010-05-20 12:24:12', 2),
(158, 'Invites the Director-General of the World Health Organization, as the lead agency in this field, to promote the mobilization of organizations, agencies, organs and programmes of the United Nations system in order to provide technical, medical and financial assistance for preventive action and intensification of the struggle against malaria, and to elaborate a plan of action detailing the coordination of all related activities in this field;', 2, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:13', '2010-05-20 12:24:13', 2),
(159, 'Requests the Secretary-General to submit to the General Assembly \nat its fiftieth session the report of the Director-General of the World Health \nOrganization, to be prepared in collaboration with other relevant \norganizations, agencies, organs and programmes of the United Nations system, on the implementation of the present resolution, including, inter alia, answers to the many questions that still need to be addressed, as well as the utilization of an effective malaria vaccine in an integrated approach, \ntogether with other malaria-control tools, including the incorporation of \nappropriate technologies for malaria control, with specific attention to the \nresults of scientific investigations concerning the latest developments in \nthis field.', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:13', '2010-05-20 12:24:13', 2),
(160, 'We resolve further:(...)To have, by then, halted, and begun to reverse, the spread of HIV/AIDS, the scourge of malaria and other major diseases that afflict humanity.', 5, 18, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:14', '2010-05-20 12:24:14', 2),
(161, 'We also resolve (...) To encourage the pharmaceutical industry to make essential drugs more widely available and affordable by all who need them in developing countries.', 5, 18, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:14', '2010-05-20 12:24:14', 2),
(162, 'Proclaims the period 2001–2010 the Decade to Roll Back Malaria in \nDeveloping Countries, Particularly in Africa', 4, 19, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(163, 'Appeals to the international community (...) to allocate substantial new and additional resources, including through the new global fund to fight HIV/AIDS, malaria and tuberculosis, launched by the Group of Eight Major Industrialized Countries at its Genoa Summit, held from 20 to 22 July 2001, and by the Secretary-General, for developing countries, particularly in Africa, with a view to enabling them to implement fully the Plan of Action adopted in Abuja for \nthe “Roll Back Malaria” initiative;', 6, 17, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(164, 'Appeals to the (...) United Nations bodies, \ninternational and regional organizations and non-governmental organizations to allocate substantial new and additional resources, including through the new global fund to fight HIV/AIDS, malaria and tuberculosis, launched by the Group of Eight Major Industrialized Countries at its Genoa Summit, held from 20 to 22 July 2001, and by the Secretary-General, for developing countries, particularly in Africa, with a view to enabling them to implement fully the Plan of Action adopted in Abuja for \nthe “Roll Back Malaria” initiative;', 3, 17, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(165, 'Commends the World Health Organization and its partners, and urges \nthem to provide the necessary support for its ongoing measures to combat malaria in developing countries, particularly in Africa, and to provide the assistance necessary for African States to meet their objectives', 2, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(166, 'Calls for joint comprehensive efforts between Africa and the international community to ensure that by 2005 the following targets are achieved: (a) At least 60 per cent of those at risk for malaria, particularly pregnant women and children under five years of age, shall benefit from the most suitable combination of personal and community protective measures, such as insecticide-treated bednets and other interventions that are accessible and affordable, to prevent infection and suffering  (b) At least 60 per cent of all pregnant women who are at risk for malaria, especially those in their first pregnancies, shall have access to chemoprophylaxis or presumptive intermittent treatment;  (c) At least 60 per cent of those suffering from malaria shall have prompt access to and shall be able to use correct, affordable and appropriate treatment  within twenty-four hours of the onset of symptoms', 6, 15, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(167, 'Reiterates the need to ensure that measures to reduce malaria transmission risks, including environmental management, are included in development planning and activities', 4, 20, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(168, 'Requests the Secretary-General, acting in close collaboration with the \nDirector-General of the World Health Organization, developing countries and regional organizations, including the Organization of African Unity, to conduct in 2005 an evaluation of the measures taken and progress made towards the achievement of the mid-term targets, the means of implementation provided by the international community in this regard and the overall goals of the Decade, and to report thereon to the General Assembly at its sixtieth session', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(169, 'Also requests the Secretary-General to report to it at its fifty-seventh session on the implementation of the present resolution', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:15', '2010-05-20 12:24:15', 2),
(170, 'Reaffirms the period 2001–2010 as the Decade to Roll Back Malaria in Developing Countries, Particularly in Africa', 4, 21, NULL, 162, 162, 'draft', '2010-05-20 12:24:16', '2010-05-20 12:24:40', 2),
(171, 'Appeals to the international community (...) to allocate substantial new resources, including through the Global Fund to Fight the Acquired Immunodeficiency Syndrome, Tuberculosis and Malaria, for developing countries, particularly in Africa, with a view to enabling them to implement fully the plan of action adopted in Abuja for the “Roll Back Malaria” initiative', 6, 17, NULL, 164, 163, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(172, 'Appeals to the (...) United Nations bodies, international and regional organizations and non-governmental organizations to allocate substantial new resources, including through the Global Fund to Fight the Acquired Immunodeficiency Syndrome, Tuberculosis and Malaria, for developing countries, particularly in Africa, with a view to enabling them to implement fully the plan of action adopted in Abuja for the “Roll Back Malaria” initiative', 3, 17, NULL, 165, 165, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(173, 'Calls upon the international community and donor Governments to encourage and facilitate the transfer of needed technology to developing countries, particularly in Africa, on favourable terms, including concessional and preferential terms, as mutually agreed, for the production of long-lasting insecticide-treated nets, to avoid the difficulties encountered with re-treatment, and to find ways to increase the availability of the new range of artemisinin-based combination drugs for multi-drug-resistant malaria', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:17', 2),
(174, 'Commends the World Health Organization and its partners, and urges \nthem to provide the necessary support for its ongoing measures to combat malaria in developing countries, particularly in Africa, and to provide the assistance necessary for African States to meet their objectives', 2, 2, NULL, 165, 165, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(175, 'Calls for joint comprehensive efforts between Africa and the international community to ensure that by 2005 the following targets are achieved: (a) At least 60 per cent of those at risk for malaria, in particular pregnant women and children under five years of age, benefit from the most suitable combination of personal and community protective measures, such as insecticide-treated bednets and other interventions that are accessible and affordable, to prevent infection and suffering;(b) At least 60 per cent of all pregnant women who are at risk for malaria, especially those in their first pregnancy, have access to chemoprophylaxis or presumptive intermittent treatment;   (c) At least 60 per cent of those suffering from malaria have prompt access to and are able to use correct, affordable and appropriate treatment within twenty-four hours of the onset of symptoms.', 6, 15, NULL, 166, 166, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(176, 'Reiterates the need to ensure that measures to reduce the risk of malaria \ntransmission, including source reduction and environmental management, such as ways to minimize mosquito breeding sites associated with existing and new development projects, are included in development planning and activities', 4, 20, NULL, 167, 167, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(177, 'Requests the Secretary-General, acting in close collaboration with the \nDirector-General of the World Health Organization, developing countries and regional organizations, including the African Union, to conduct in 2005 an evaluation of the measures taken and progress made towards the achievement of the mid-term targets, the means of implementation provided by the international community in this regard and the overall goals of the Decade, and to report thereon to the General Assembly at its sixtieth session', 2, 3, NULL, 168, 168, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(178, 'Also requests the Secretary-General to report to the General Assembly at its fifty-eighth session on the implementation of the present resolution', 2, 3, NULL, 169, 169, 'draft', '2010-05-20 12:24:17', '2010-05-20 12:24:40', 2),
(179, 'Calls upon the international community to continue to support the “Roll \nBack Malaria” partner organizations, including the World Health Organization and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:18', '2010-05-20 12:24:18', 2),
(180, 'Appeals to the international community to ensure that the Global Fund to \nFight AIDS, Tuberculosis and Malaria receives increased funding to support sound national plans to control malaria in endemic countries to be implemented in a sustained and equitable way that contributes to health system development', 6, 17, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:18', '2010-05-20 12:24:18', 2),
(181, 'Urges malaria-endemic countries to increase domestic resource allocation to malaria control', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:18', '2010-05-20 12:24:18', 2),
(182, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of nets to consumers and to stimulate free trade in insecticide-treated nets', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:19', 2),
(183, 'Calls upon the international community to support ways of stimulating \nthe development of manufacturing capacity of insecticide-treated nets in Africa and, in this connection, to encourage and facilitate the transfer of technology needed to make insecticide-treated nets more effective and long-lasting', 6, 9, NULL, 173, 173, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:40', 2),
(184, 'Recognizes the importance of the development of effective vaccines and \nnew medicines to prevent and treat malaria, and the need for further research, including through effective global partnerships such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, in securing their development', 4, 22, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:19', 2),
(185, 'Reiterates the need for expanded public-private partnerships for malaria \ncontrol and prevention, and in this context urges petroleum companies operating in Africa to consider providing polymer for the manufacture of mosquito nets at reduced prices as a contribution to rolling back malaria in Africa', 3, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:19', 2),
(186, 'Urges the pharmaceutical industry to take note of the increasing need for \neffective combination treatment for malaria, particularly in Africa, and to form additional alliances and partnerships to help to ensure that all people at risk have access to prompt, affordable and quality treatment;', 3, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:19', 2),
(187, 'Requests the Secretary-General, in close collaboration with the World \nHealth Organization, developing countries and regional organizations, including the African Union, to conduct in 2005 an evaluation of the measures taken and progress made towards the achievement of the mid-term targets, the means of implementation provided by the international community in this regard and the overall goals of the Decade, and to report thereon to the General Assembly at its sixtieth session', 2, 3, NULL, 177, 168, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:40', 2),
(188, 'Also requests the Secretary-General to report to the General Assembly at \nits fifty-ninth session on the implementation of the present resolution, under the agenda item entitled “2001–2010: Decade to Roll Back Malaria in Developing Countries, Particularly in Africa”', 2, 3, NULL, 178, 169, 'draft', '2010-05-20 12:24:19', '2010-05-20 12:24:40', 2),
(189, 'Calls upon the international community to continue to support the “Roll Back Malaria” partner organizations, including the World Health Organization and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 179, 179, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:40', 2),
(190, 'Appeals to the international community to ensure increased support for \nbilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist in the development of sound national plans to control malaria in malaria-endemic countries and their implementation in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 180, 180, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:40', 2),
(191, 'Urges malaria-endemic countries to increase domestic resource allocation to malaria control', 5, 2, NULL, 181, 181, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:40', 2),
(192, 'Encourages all African countries that have not yet done so to implement the recommendations of the Abuja Summit to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of nets to consumers and to stimulate free trade in insecticide-treated nets', 7, 16, NULL, 182, 182, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:40', 2),
(193, 'Calls upon malaria-endemic countries, in particular those in sub-Saharan \nAfrica, to establish and strengthen policies and programmes to ensure a rapid scale-up in the coverage of insecticide-treated nets to at least 60 per cent of those at risk, wherever the use of such nets is the vector-control method of choice, by applying expeditious approaches, including targeted free or highly subsidized distribution to vulnerable groups', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:20', 2),
(194, 'Encourages all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, in a timely manner', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:20', 2),
(195, 'Recognizes the importance of the development of effective vaccines and new medicines to prevent and treat malaria and the need for further and accelerated research, including through effective global partnerships such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, where necessary stimulated by new incentives to secure their development', 4, 22, NULL, 184, 184, 'draft', '2010-05-20 12:24:20', '2010-05-20 12:24:40', 2),
(196, 'Reiterates the need for expanded public-private partnerships for malaria \ncontrol and prevention, and in this context urges petroleum companies operating in Africa to consider providing polymer for the manufacture of mosquito nets at reduced prices as a contribution to rolling back malaria in Africa', 3, 2, NULL, 185, 185, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:40', 2),
(197, 'Calls upon the international community to support investment in the \ndevelopment of new anti-malarial medicines and insecticides for the effective control of malaria in view of the challenging resistance of the parasite to anti-malarial medicines and the resistance of mosquitoes to insecticides', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:21', 2),
(198, 'Also calls upon the international community to support ways to expand \naccess to artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in Africa, including the commitment of new funds, innovative mechanisms for the financing and national procurement of artemisinin-based combination therapy and the scaling up of artemisinin production to meet the increased need', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:21', 2),
(199, 'Further calls upon the international community to support coordinated \nefforts to improve surveillance, monitoring and evaluation systems so as to better track and report changes in the coverage of recommended “Roll Back Malaria” interventions and subsequent reductions in the burden of malaria', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:21', 2),
(200, 'Requests the Secretary-General, in close collaboration with the World Health Organization, the United Nations Children’s Fund, developing countries and regional organizations, including the African Union, to conduct in 2005 an evaluation of the measures taken and progress made towards the achievement of the mid-term targets, the means of implementation provided by the international community in this regard and the overall goals of the Decade, and to report thereon to the General Assembly at its sixtieth session', 2, 3, NULL, 187, 168, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:40', 2),
(201, 'Also requests the Secretary-General to report to the General Assembly at its sixtieth session on the implementation of the present resolution under the agenda item entitled “2001–2010: Decade to Roll Back Malaria in Developing Countries, Particularly in Africa”', 2, 3, NULL, 188, 169, 'draft', '2010-05-20 12:24:21', '2010-05-20 12:24:40', 2),
(202, 'Calls upon the international community to continue to support the “Roll \nBack Malaria” partner organizations, including the World Health Organization and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 189, 179, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:40', 2),
(203, 'Appeals to the international community to work towards increased and \nsustained bilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist States, in particular malaria-endemic countries, to implement sound national plans to control malaria in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 190, 180, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:40', 2),
(204, 'Urges malaria-endemic countries to work towards financial sustainability, to increase, to the extent possible, domestic resource allocation to malaria control and to create favourable conditions for working with the private sector in order to improve access to good-quality malaria services', 5, 2, NULL, 191, 181, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:41', 2),
(205, 'Calls upon Member States, in particular malaria-endemic countries, to \nestablish and/or strengthen national policies and operational plans, aspiring to ensure that at least 80 per cent of those at risk of or suffering from malaria may benefit from major preventive and curative interventions by 2010, in accordance with the technical recommendations of the World Health Organization, so as to ensure a reduction in the burden of malaria by at least 50 per cent by 2010 and 75 per cent by 2015', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:22', 2),
(206, 'Urges Member States to assess and respond to the needs for integrated \nhuman resources at all levels of the health system, in order to achieve the targets of the Abuja Declaration on Roll Back Malaria in Africa and the internationally agreed development goals of the United Nations Millennium Declaration, and to take actions, as appropriate, to effectively govern the recruitment, training and retention of health personnel', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:22', 2),
(207, 'Calls upon the international community, inter alia, by helping to meet the \nfinancial needs of the Global Fund to Fight AIDS, Tuberculosis and Malaria and through country-led initiatives with adequate international support, to create conditions for full access to insecticide-treated mosquito nets, insecticides for indoor residual spraying for malaria control and effective antimalarial combination treatments, including through the free distribution of such nets where appropriate', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:22', 2),
(208, 'Requests relevant international organizations, in particular the World \nHealth Organization and the United Nations Children’s Fund, to assist efforts of national Governments to establish universal protection of young children and pregnant women in malaria-endemic countries, particularly in Africa, with insecticide-treated nets as rapidly as possible, with due regard to ensuring sustainability through full community participation and implementation through the health system', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:22', '2010-05-20 12:24:22', 2),
(209, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of nets to consumers and to stimulate free trade in insecticide-treated nets', 7, 16, NULL, 192, 182, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:41', 2),
(210, 'Encourages all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, in a timely manner', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:23', 2),
(211, 'Recognizes the importance of the development of effective vaccines and \nnew medicines to prevent and treat malaria and the need for further and accelerated research, including by providing support to the United Nations Children’s Fund/United Nations Development Programme/World Bank/World Health Organization Special Programme for Research and Training in Tropical Diseases and through effective global partnerships such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, where necessary stimulated by new incentives to secure their development', 4, 22, NULL, 195, 184, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:41', 2),
(212, 'Calls upon the international community to support investment in the \ndevelopment of new medicines to prevent and treat malaria, especially for children and pregnant women, sensitive and specific diagnostic tests, effective vaccines, and new insecticides and delivery modes in order to enhance effectiveness and delay the onset of resistance, including through existing partnerships', 6, 9, NULL, 197, 197, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:41', 2),
(213, 'Also calls upon the international community to support ways to expand \naccess to artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in Africa, including the commitment of new funds, innovative mechanisms for the financing and national procurement of artemisinin-based combination therapy and the scaling up of artemisinin production to meet the increased need', 6, 9, NULL, 198, 198, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:41', 2);
INSERT INTO `clause_body` (`id`, `content`, `information_type_id`, `operative_phrase_id`, `public_comment`, `parent_clause_body_id`, `root_clause_body_id`, `status`, `created_at`, `updated_at`, `author_id`) VALUES
(214, 'Calls upon malaria-endemic countries to encourage regional and intersectoral collaboration, both public and private, at all levels, especially in education, agriculture, economic development and the environment, to advance malaria control objectives', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:23', 2),
(215, 'Calls upon the international community to support increased interventions, in line with the recommendations of the Roll Back Malaria Partnership, in order to ensure their rapid, efficient and effective implementation, to strengthen health systems, to monitor for counterfeit anti-malarial medicines and prevent the distribution and use of them, and to support coordinated efforts, inter alia, by providing technical assistance to improve surveillance, monitoring and evaluation systems and their alignment with national plans and systems so as to better track and report changes in coverage and the need for scaling up recommended interventions and subsequent reductions in the burden of malaria', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:23', 2),
(216, 'Urges Member States, the international community and all relevant \nactors, including the private sector, to promote the coordinated implementation and enhance the quality of malaria-related activities, including via the Roll Back Malaria Partnership, in accordance with national policies and operational plans that are consistent with the technical recommendations of the World Health Organization and recent efforts and initiatives, including the Paris Declaration on Aid Effectiveness', 5, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:23', 2),
(217, 'Requests the Secretary-General to report to the General Assembly at its \nsixty-first session on the implementation of the present resolution under the agenda item entitled “2001–2010: Decade to Roll Back Malaria in Developing Countries, Particularly in Africa”', 2, 3, NULL, 201, 169, 'draft', '2010-05-20 12:24:23', '2010-05-20 12:24:41', 2),
(218, 'Calls upon the international community to continue to support the “Roll \nBack Malaria” partner organizations, including the World Health Organization, the World Bank and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 202, 179, 'draft', '2010-05-20 12:24:24', '2010-05-20 12:24:41', 2),
(219, 'Appeals to the international community to work towards increased and \nsustained bilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist States, in particular malaria-endemic countries, to implement sound national plans to control malaria in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 203, 180, 'draft', '2010-05-20 12:24:24', '2010-05-20 12:24:41', 2),
(220, 'Urges malaria-endemic countries to work towards financial sustainability, to increase, to the extent possible, domestic resource allocation to malaria control and to create favourable conditions for working with the private sector in order to improve access to good-quality malaria services', 5, 2, NULL, 204, 181, 'draft', '2010-05-20 12:24:24', '2010-05-20 12:24:41', 2),
(221, 'Calls upon Member States, in particular malaria-endemic countries, to \nestablish and/or strengthen national policies and operational plans, aspiring to ensure that at least 80 per cent of those at risk of or suffering from malaria may benefit from major preventive and curative interventions by 2010, in accordance with the technical recommendations of the World Health Organization, so as to ensure a reduction in the burden of malaria by at least 50 per cent by 2010 and 75 per cent by 2015', 5, 9, NULL, 205, 205, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(222, 'Urges Member States to assess and respond to the needs for integrated \nhuman resources at all levels of the health system, in order to achieve the targets of the Abuja Declaration on Roll Back Malaria in Africa and the internationally agreed development goals of the United Nations Millennium Declaration, to take actions, as appropriate, to effectively govern the recruitment, training and retention of skilled health personnel, and to give particular focus to the availability of skilled personnel at all levels to meet technical and operational needs as increased funding for malaria control programmes becomes available', 5, 2, NULL, 206, 206, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(223, 'Calls upon the international community, inter alia, by helping to meet the \nfinancial needs of the Global Fund to Fight AIDS, Tuberculosis and Malaria and through country-led initiatives with adequate international support, to intensify access to affordable, safe and effective antimalarial combination treatments, intermittent preventive treatment in pregnancies, insecticide-treated mosquito nets, including through the free distribution of such nets where appropriate, and insecticides for indoor residual spraying for malaria control, taking into account relevant international rules, standards and guidelines', 6, 9, NULL, 207, 207, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(224, 'Requests relevant international organizations, in particular the World \nHealth Organization and the United Nations Children’s Fund, to assist efforts of national Governments to establish universal protection of young children and pregnant women in malaria-endemic countries, particularly in Africa, with insecticide-treated nets as rapidly as possible, with due regard to ensuring sustainability through full community participation and implementation through the health system', 2, 3, NULL, 208, 208, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(225, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit in 2000 to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of the products to consumers and to stimulate free trade in those products', 7, 16, NULL, 209, 182, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(226, 'Expresses its concern about the increase in resistant strains of malaria in \nseveral regions of the world, and calls upon Member States, with support from the World Health Organization, to strengthen surveillance systems for drug and insecticide resistance', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:25', 2),
(227, 'Urges all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, and to develop the necessary financial, legislative and regulatory mechanisms in order to introduce artemisinin combination therapies at affordable prices and to prohibit the marketing of oral artemisinin monotherapies, in a timely manner', 5, 2, NULL, 211, 184, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(228, 'Recognizes the importance of the development of safe and cost-effective \nvaccines and new medicines to prevent and treat malaria and the need for further and accelerated research, including into safe, effective and high-quality traditional therapies, using rigorous standards, including by providing support to the Special Programme for Research and Training in Tropical Diseases and through effective global partnerships such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, where necessary stimulated by new incentives to secure their development', 4, 22, NULL, 211, 184, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(229, 'Calls upon the international community, including through existing \npartnerships, to increase investment in and efforts towards the research and development of new, safe and affordable malaria-related medicines, products and technologies, such as vaccines, rapid diagnostic tests, insecticides and delivery modes, to prevent and treat malaria, especially for at-risk children and pregnant women, in order to enhance effectiveness and delay the onset of resistance', 6, 9, NULL, 212, 197, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:41', 2),
(230, 'Reaffirms the right to use, to the fullest extent, the provisions contained \nin the World Trade Organization Agreement on Trade-Related Aspects of \nIntellectual Property Rights (TRIPS Agreement), the Doha Declaration on the TRIPS Agreement and Public Health,  the decision of the World Trade \nOrganization’s General Council of 30 August 2003 and amendments to article 31 of the Agreement, which provide flexibilities for the protection of public health, and in particular to promote access to medicines for all, including the production, under compulsory licensing, of generic drugs in the prevention and treatment of malaria', 4, 21, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:25', 2),
(231, 'Resolves to assist developing countries to employ the flexibilities outlined in the TRIPS Agreement in the fight against malaria and to strengthen their capacities for this purpose', 6, 4, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:25', 2),
(232, 'Calls upon the international community to support ways to expand access \nto and the affordability of key products, such as vector control measures, including indoor residual spraying, long-lasting insecticide-treated nets and artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in malaria-endemic countries, particularly in Africa, including the commitment of new funds, innovative mechanisms for the financing and national procurement of artemisinin-based combination therapy, and the scaling up of artemisinin production to meet the increased need', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:25', '2010-05-20 12:24:25', 2),
(233, 'Encourages the producers of long-lasting insecticide-treated nets to accelerate technology transfer to developing countries and encourages malaria-endemic countries, including with the support of the International Finance Corporation, to explore and pursue possible opportunities to scale up production of long-lasting insecticide-treated nets', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:26', 2),
(234, 'Calls upon the international community and malaria-endemic countries, \nin accordance with existing guidelines and recommendations from the World Health Organization and the requirements of the Stockholm Convention on Persistent Organic Pollutants to increase capacity for the safe, effective and judicious use of indoor residual spraying and other forms of vector control', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:26', 2),
(235, 'Urges the international community to become fully knowledgeable about \nWorld Health Organization technical policies and strategies, including for indoor residual spraying, insecticide-treated nets and case management, intermittent preventive treatment for pregnant women and monitoring of in vivo resistance studies to artemisinin-based combination therapy treatment, so that projects support those policies and strategies', 6, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:26', 2),
(236, 'Requests the World Health Organization, the United Nations Children’s \nFund and donor agencies to provide support to those countries which choose to use DDT for indoor residual spraying so as to ensure that it is implemented in accordance with international rules, standards and guidelines, and to provide all possible support to malaria-endemic countries to manage the intervention effectively and prevent the contamination of agricultural products with DDT and other insecticides used for indoor residual spraying', 2, 3, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:26', 2),
(237, 'Calls upon malaria-endemic countries to encourage regional and intersectoral collaboration, both public and private, at all levels, especially in education, agriculture, economic development and the environment, to advance malaria control objectives', 6, 9, NULL, 214, 214, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:41', 2),
(238, 'Calls upon the international community to support increased interventions, in line with the recommendations of the World Health Organization and the Roll Back Malaria Partnership, in order to ensure their rapid, efficient and effective implementation, to strengthen health systems, to monitor and fight against the trade in counterfeit antimalarial medicines and prevent the distribution and use of them, and to support coordinated efforts, inter alia, by providing technical assistance to improve surveillance, monitoring and evaluation systems and their alignment with national plans and systems so as to better track and report changes in coverage, the need for scaling up recommended interventions and the subsequent reductions in the burden of malaria', 6, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:26', 2),
(239, 'Urges Member States, the international community and all relevant actors, including the private sector, to promote the coordinated implementation and enhance the quality of malaria-related activities, including via the Roll Back Malaria Partnership, in accordance with national policies and operational plans that are consistent with the technical recommendations of the World Health Organization and recent efforts and initiatives, including the Paris Declaration on Aid Effectiveness', 5, 2, NULL, 216, 216, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:41', 2),
(240, 'Requests the Secretary-General to report to the General Assembly at its \nsixty-second session on the implementation of the present resolution under the agenda item entitled “2001–2010: Decade to Roll Back Malaria in Developing Countries, Particularly in Africa”', 2, 3, NULL, 217, 169, 'draft', '2010-05-20 12:24:26', '2010-05-20 12:24:41', 2),
(241, 'Calls upon the international community to continue to support the “Roll \nBack Malaria” partner organizations, including the World Health Organization, the World Bank and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 218, 179, 'draft', '2010-05-20 12:24:27', '2010-05-20 12:24:41', 2),
(242, 'Appeals to the international community to work in a spirit of cooperation towards effective, increased, harmonized and \nsustained bilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist States, in particular malaria-endemic countries, to implement sound national plans, in particular health plans and sanitation plans, including malaria control strategies and integrated management of childhood illnesses, in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 219, 180, 'draft', '2010-05-20 12:24:27', '2010-05-20 12:24:41', 2),
(243, 'Urges malaria-endemic countries to work towards financial sustainability, to increase, to the extent possible, domestic resource allocation to malaria control and to create favourable conditions for working with the private sector in order to improve access to good-quality malaria services', 5, 2, NULL, 220, 181, 'draft', '2010-05-20 12:24:27', '2010-05-20 12:24:41', 2),
(244, 'Calls upon Member States, in particular malaria-endemic countries, to \nestablish and/or strengthen national policies and operational plans, aspiring to ensure that at least 80 per cent of those at risk of or suffering from malaria may benefit from major preventive and curative interventions by 2010, in accordance with the technical recommendations of the World Health Organization, so as to ensure a reduction in the burden of malaria by at least 50 per cent by 2010 and 75 per cent by 2015', 5, 9, NULL, 221, 205, 'draft', '2010-05-20 12:24:27', '2010-05-20 12:24:41', 2),
(245, 'Urges Member States to assess and respond to the needs for integrated \nhuman resources at all levels of the health system, in order to achieve the targets of the Abuja Declaration on Roll Back Malaria in Africa and the internationally agreed development goals of the United Nations Millennium Declaration, to take actions, as appropriate, to effectively govern the recruitment, training and retention of skilled health personnel, and to give particular focus to the availability of skilled personnel at all levels to meet technical and operational needs as increased funding for malaria control programmes becomes available', 5, 2, NULL, 222, 206, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(246, 'Calls upon the international community, inter alia, by helping to meet the \nfinancial needs of the Global Fund to Fight AIDS, Tuberculosis and Malaria and through country-led initiatives with adequate international support, to intensify access to affordable, safe and effective antimalarial combination treatments, intermittent preventive treatment in pregnancies, long-lasting insecticide-treated mosquito nets, including through the free distribution of such nets where appropriate, and insecticides for indoor residual spraying for malaria control, taking into account relevant international rules, standards and guidelines', 6, 9, NULL, 223, 207, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(247, 'Requests relevant international organizations, in particular the World \nHealth Organization and the United Nations Children’s Fund, to assist efforts of national Governments to establish universal protection of young children and pregnant women in malaria-endemic countries, particularly in Africa, with long-lasting insecticide-treated nets as rapidly as possible, with due regard to ensuring sustainability through full community participation and implementation through the health system', 2, 3, NULL, 224, 208, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(248, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit in 2000 to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of the products to consumers and to stimulate free trade in those products', 7, 16, NULL, 225, 182, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(249, 'Expresses its concern about the increase in resistant strains of malaria in \nseveral regions of the world, and calls upon Member States, with support from the World Health Organization, to strengthen surveillance systems for drug and insecticide resistance and for the World Health Organization to coordinate a network for the monitoring of drug and insecticide resistance', 5, 9, NULL, 226, 226, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(250, 'Urges all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, and to develop the necessary financial, legislative and regulatory mechanisms in order to introduce artemisinin combination therapies at affordable prices and to prohibit the marketing of oral artemisinin monotherapies, in a timely manner', 5, 2, NULL, 227, 184, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(251, 'Recognizes the importance of the development of safe and cost-effective \nvaccines and new medicines to prevent and treat malaria and the need for further and accelerated research, including into safe, effective and high-quality traditional therapies, using rigorous standards, including by providing support to the Special Programme for Research and Training in Tropical Diseases and through effective global partnerships such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, where necessary stimulated by new incentives to secure their development and through effective and timely support towards pre-qualification of new antimalarials and their combinations', 4, 22, NULL, 228, 184, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(252, 'Calls upon the international community, including through existing \npartnerships, to increase investment in and efforts towards the research and development of new, safe and affordable malaria-related medicines, products and technologies, such as vaccines, rapid diagnostic tests, insecticides and delivery modes, to prevent and treat malaria, especially for at-risk children and pregnant women, in order to enhance effectiveness and delay the onset of resistance', 6, 9, NULL, 229, 197, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(253, 'Reaffirms the right to use, to the fullest extent, the provisions contained \nin the World Trade Organization Agreement on Trade-Related Aspects of \nIntellectual Property Rights (TRIPS Agreement), the Doha Declaration on the TRIPS Agreement and Public Health,  the decision of the World Trade \nOrganization’s General Council of 30 August 2003 and amendments to article 31 of the Agreement, which provide flexibilities for the protection of public health, and in particular to promote access to medicines for all, including the production, under compulsory licensing, of generic drugs in the prevention and treatment of malaria', 4, 21, NULL, 230, 230, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(254, 'Resolves to assist developing countries to employ the flexibilities outlined in the TRIPS Agreement in the fight against malaria and to strengthen their capacities for this purpose', 6, 4, NULL, 231, 231, 'draft', '2010-05-20 12:24:28', '2010-05-20 12:24:41', 2),
(255, 'Calls upon the international community to support ways to expand access \nto and the affordability of key products, such as vector control measures, including indoor residual spraying, long-lasting insecticide-treated nets and artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in malaria-endemic countries, particularly in Africa, including through additional funds and innovative mechanisms, inter alia, for the financing and scaling up of artemisinin production and procurement, as appropriate, to meet the increased need', 6, 9, NULL, 232, 232, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(256, 'Encourages the producers of long-lasting insecticide-treated nets to accelerate technology transfer to developing countries', 8, 16, NULL, 233, 233, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(257, 'encourages the World Bank and regional development funds to consider supporting malaria-endemic countries to establish factories to scale up production of long-lasting insecticide-treated nets', 8, 16, NULL, 233, 233, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(258, 'Calls upon the international community and malaria-endemic countries, \nin accordance with existing guidelines and recommendations from the World Health Organization and the requirements of the Stockholm Convention on Persistent Organic Pollutants to increase capacity for the safe, effective and judicious use of indoor residual spraying and other forms of vector control', 6, 9, NULL, 234, 234, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(259, 'Urges the international community to become fully knowledgeable about \nWorld Health Organization technical policies and strategies, including for indoor residual spraying, long-lasting insecticide-treated nets and case management, intermittent preventive treatment for pregnant women and monitoring of in vivo resistance studies to artemisinin-based combination therapy treatment, so that projects support those policies, strategies and provisions', 6, 2, NULL, 235, 235, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(260, 'Requests the World Health Organization, the United Nations Children’s \nFund and donor agencies to provide support to those countries which choose to use DDT for indoor residual spraying so as to ensure that it is implemented in accordance with international rules, standards and guidelines, and to provide all possible support to malaria-endemic countries to manage the intervention effectively and prevent the contamination, in particular, of agricultural products with DDT and other insecticides used for indoor residual spraying', 2, 3, NULL, 236, 236, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(261, 'Encourages the World Health Organization and its member States, with the support of the parties to the Stockholm Convention, to continue to explore possible alternatives to DDT as vector control agent', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:29', 2),
(262, 'Calls upon malaria-endemic countries to encourage regional and intersectoral collaboration, both public and private, at all levels, especially in education, health, agriculture, economic development and the environment, to advance malaria control objectives', 6, 9, NULL, 237, 214, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(263, 'Calls upon the international community to support increased interventions, in line with the recommendations of the World Health Organization and the Roll Back Malaria Partnership, in order to ensure their rapid, efficient and effective implementation, to strengthen health systems and national pharmaceutical policies, to monitor and fight against the trade in counterfeit antimalarial medicines and prevent the distribution and use of them, and to support coordinated efforts, inter alia, by providing technical assistance to improve surveillance, monitoring and evaluation systems and their alignment with national plans and systems so as to better track and report changes in coverage, the need for scaling up recommended interventions and the subsequent reductions in the burden of malaria', 6, 9, NULL, 238, 238, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(264, 'Urges Member States, the international community and all relevant actors, including the private sector, to promote the coordinated implementation and enhance the quality of malaria-related activities, including via the Roll Back Malaria Partnership, in accordance with national policies and operational plans that are consistent with the technical recommendations of the World Health Organization and recent efforts and initiatives, including the Paris Declaration on Aid Effectiveness', 5, 2, NULL, 239, 216, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:41', 2),
(265, 'Requests the Secretary-General to report to the General Assembly at its \nsixty-third session on the implementation of the present resolution under the agenda item entitled “2001–2010: Decade to Roll Back Malaria in Developing Countries, Particularly in Africa”', 2, 3, NULL, 240, 169, 'draft', '2010-05-20 12:24:29', '2010-05-20 12:24:42', 2),
(266, 'Urges the international community to deliver on programmes and activities at the country level in order to achieve internationally agreed targets on malaria', 6, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:30', '2010-05-20 12:24:30', 2),
(267, 'Calls upon the international community to continue to support the \nsecretariat of the Roll Back Malaria Partnership and partner organizations, including the World Health Organization, the World Bank and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 241, 179, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(268, 'Appeals to the international community to work in a spirit of cooperation \ntowards effective, increased, harmonized and sustained bilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist States, in particular malaria-endemic countries, to implement sound national plans, in particular health plans and sanitation plans, including malaria control strategies and integrated management of childhood illnesses, in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 242, 180, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(269, 'Appeals to the malaria partners to resolve the financial and delivery \nbottlenecks that are responsible for stock-outs of long-lasting insecticide-treated nets, artemisinin-based combination therapies and rapid diagnostic tests at the national level, whenever they occur, including through the strengthening of malaria programme management at the country level', 3, 17, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:31', 2),
(270, 'Urges malaria-endemic countries to work towards financial sustainability, \nto increase, to the extent possible, domestic resource allocation to malaria control and to create favourable conditions for working with the private sector in order to improve access to good-quality malaria services', 5, 2, NULL, 243, 181, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(271, 'Urges Member States to assess and respond to the needs for integrated \nhuman resources at all levels of the health system, in order to achieve the targets of the Abuja Declaration on Roll Back Malaria in Africa and the internationally agreed development goals of the United Nations Millennium Declaration, to take actions, as appropriate, to effectively govern the recruitment, training and retention of skilled health personnel, and to give particular focus to the availability of skilled personnel at all levels to meet technical and operational needs as increased funding for malaria control programmes becomes available', 5, 2, NULL, 245, 206, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(272, 'Calls upon the international community, inter alia, by helping to meet the \nfinancial needs of the Global Fund to Fight AIDS, Tuberculosis and Malaria and through country-led initiatives with adequate international support, to intensify access to affordable, safe and effective antimalarial combination treatments, intermittent preventive treatment in pregnancies, long-lasting insecticide-treated mosquito nets, including, where appropriate, through the free distribution of such nets and, where appropriate, to insecticides for indoor residual spraying for malaria control, taking into account relevant international rules, including the Stockholm Convention on Persistent Organic Pollutants standards and guidelines;', 6, 9, NULL, 246, 207, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(273, 'Requests relevant international organizations, in particular the World \nHealth Organization and the United Nations Children’s Fund, to assist efforts of national Governments to provide universal access to malaria control interventions to at-risk young children and pregnant women in malaria-endemic countries, particularly in Africa, as rapidly as possible, with due regard to ensuring proper use of those interventions, including long-lasting insecticide nets, and sustainability through full community participation and implementation through the health system', 2, 3, NULL, 247, 208, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(274, 'Calls upon Member States, in particular malaria-endemic countries, to \nestablish and/or strengthen national policies and operational plans, with a view to ensuring the achievement of the targets for 2010 and 2015, in accordance with the technical recommendations of the World Health Organization, so as to ensure the achievement of targets set out in the Global Malaria Action Plan and to promote the achievement of the malaria-related Millennium Development Goals', 5, 9, NULL, 244, 205, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(275, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit in 2000 to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of the products to consumers and to stimulate free trade in those products', 7, 16, NULL, 248, 182, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(276, 'Invites all malaria-endemic countries, with the support of the international community, to scale up their efforts to meet the internationally agreed targets on malaria for 2010 and 2015', 7, 13, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:31', 2),
(277, 'Calls upon United Nations agencies and their partners to continue to provide the technical support necessary to build and enhance the planning and implementation capacity of Member States to meet the internationally agreed goals', 2, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:31', 2),
(278, 'Expresses its concern about the increase in resistant strains of malaria in \nseveral regions of the world, and calls upon Member States, with support from the World Health Organization and other partners, to strengthen surveillance systems for drug and insecticide resistance and upon the World Health Organization to coordinate a global network for the monitoring of drug and insecticide resistance and to ensure that drug and insecticide testing is fully operational in order to enhance the use of current insecticide- and artemisinin-based combination therapies', 5, 9, NULL, 249, 226, 'draft', '2010-05-20 12:24:31', '2010-05-20 12:24:42', 2),
(279, 'Urges all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, and to develop the necessary financial, legislative and regulatory mechanisms in order to introduce artemisinin combination therapies at affordable prices and to prohibit the marketing of oral artemisinin monotherapies, in a timely manner', 5, 2, NULL, 250, 184, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(280, 'Recognizes the importance of the development of safe and cost-effective \nvaccines and new medicines to prevent and treat malaria and the need for further and accelerated research, including into safe, effective and high-quality traditional therapies, using rigorous standards, including by providing support to the Special Programme for Research and Training in Tropical Diseases and through effective global partnerships, such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, where necessary stimulated by new incentives to secure their development and through effective and timely support towards pre-qualification of new antimalarials and their combinations', 4, 22, NULL, 251, 184, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(281, 'Calls upon the international community, including through existing \npartnerships, to increase investment in and efforts towards the research and development of new, safe and affordable malaria-related medicines, products and technologies, such as vaccines, rapid diagnostic tests, insecticides and delivery modes, to prevent and treat malaria, especially for at-risk children and pregnant women, in order to enhance effectiveness and delay the onset of resistance', 6, 9, NULL, 252, 197, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(282, 'Calls upon malaria-endemic countries to assure favourable conditions for \nresearch institutions, including allocation of adequate resources and development of national policies and legal frameworks, where appropriate, with a view to, inter alia, informing policy formulation and strategic interventions on malaria', 5, 9, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:32', 2),
(283, 'Reaffirms the right to use, to the fullest extent, the provisions contained \nin the World Trade Organization Agreement on Trade-Related Aspects of \nIntellectual Property Rights (TRIPS Agreement), the Doha Declaration on the TRIPS Agreement and Public Health,  the decision of the World Trade \nOrganization’s General Council of 30 August 2003 and amendments to article 31 of the Agreement, which provide flexibilities for the protection of public health, and in particular to promote access to medicines for all, including the production, under compulsory licensing, of generic drugs in the prevention and treatment of malaria, and resolves to assist developing countries in this regard', 6, 4, NULL, 253, 230, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(284, 'Calls upon the international community to support ways to expand access \nto and the affordability of key products, such as vector control measures, including indoor residual spraying, long-lasting insecticide-treated nets and artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in malaria-endemic countries, particularly in Africa, including through additional funds and innovative mechanisms, inter alia, for the financing and scaling up of artemisinin production and procurement, as appropriate, to meet the increased need', 6, 9, NULL, 255, 232, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(285, 'Encourages the producers of long-lasting insecticide-treated nets to accelerate technology transfer to developing countries and encourages the World Bank and regional development funds to consider supporting malaria-endemic countries in establishing factories to scale up production of long-lasting insecticide-treated nets', 8, 16, NULL, 257, 233, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(286, 'Calls upon the international community and malaria-endemic countries, \nin accordance with existing guidelines and recommendations of the World Health Organization and the requirements of the Stockholm Convention to increase capacity for the safe, effective and judicious use of indoor residual spraying and other forms of vector control', 6, 9, NULL, 258, 234, 'draft', '2010-05-20 12:24:32', '2010-05-20 12:24:42', 2),
(287, 'Urges the international community to become fully knowledgeable about \nWorld Health Organization technical policies and strategies and the provisions in the Stockholm Convention related to the use of DDT, including for indoor residual spraying, long-lasting insecticide-treated nets and case management, intermittent preventive treatment for pregnant women and monitoring of in vivo resistance studies to artemisinin-based combination therapy treatment, so that projects support those policies, strategies and provisions', 6, 2, NULL, 259, 235, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(288, 'Requests the World Health Organization, the United Nations Children’s \nFund and donor agencies to provide support to those countries which choose to use DDT for indoor residual spraying so as to ensure that it is implemented in accordance with international rules, standards and guidelines, and to provide all possible support to malaria-endemic countries to manage the intervention effectively and prevent the contamination, in particular, of agricultural products with DDT and other insecticides used for indoor residual spraying', 2, 3, NULL, 260, 236, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(289, 'Encourages the World Health Organization and its member States, with \nthe support of the parties to the Stockholm Convention, to continue to explore possible alternatives to DDT as a vector control agent', 7, 16, NULL, 261, 261, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(290, 'Calls upon malaria-endemic countries to encourage regional and \nintersectoral collaboration, both public and private, at all levels, especially in education, health, agriculture, economic development and the environment, to advance malaria control objectives', 6, 9, NULL, 262, 214, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(291, 'Calls upon the international community to support increased interventions, in line with the Global Malaria Action Plan and the recommendations of the World Health Organization and the Roll Back Malaria Partnership, in order to ensure their rapid, efficient and effective implementation, to strengthen health systems and national pharmaceutical policies, to monitor and fight against the trade in counterfeit antimalarial medicines and prevent the distribution and use of them, and to support coordinated efforts, inter alia, by providing technical assistance to improve surveillance, monitoring and evaluation systems and their alignment with national plans and systems so as to better track and report changes in coverage, the need for scaling up recommended interventions and the subsequent reductions in the burden of malaria', 6, 9, NULL, 263, 238, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(292, 'Urges Member States, the international community and all relevant \nactors, including the private sector, to promote the coordinated implementation and enhance the quality of malaria-related activities, including via the Roll Back Malaria Partnership, in accordance with national policies and operational plans that are consistent with the technical recommendations of the World Health Organization and recent efforts and initiatives, including, where appropriate, the Paris Declaration on Aid Effectiveness and the Accra Agenda for Action, adopted during the Third High-level Forum on Aid Effectiveness, held in Accra from 2 to 4 September 2008', 5, 2, NULL, 264, 216, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(293, 'Requests the Secretary-General, in close collaboration with the Director- \nGeneral of the World Health Organization and in consultation with Member States, to submit to the General Assembly at its sixty-fourth session an evaluation report on progress achieved towards the internationally agreed targets for 2010, including funding and implementation of activities necessary to reach those targets', 2, 3, NULL, 265, 169, 'draft', '2010-05-20 12:24:33', '2010-05-20 12:24:42', 2),
(294, 'Encourages Member States, (...) to continue to observe World Malaria Day and to collaborate in the observance of the final year of the Decade to Roll Back Malaria in Developing Countries, Particularlyin Africa, in order to raise public awareness of and knowledge about the prevention, control and treatment of malaria as well as the importance of meeting the Millennium Development Goals', 7, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:34', '2010-05-20 12:24:34', 2),
(295, 'Encourages (...) relevant organizations of the United Nations \nsystem, international institutions, non-governmental organizations, the private sector and civil society to continue to observe World Malaria Day and to collaborate in the observance of the final year of the Decade to Roll Back Malaria in Developing Countries, Particularlyin Africa, in order to raise public awareness of and knowledge about the prevention, control and treatment of malaria as well as the importance of meeting the Millennium Development Goals', 8, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:34', '2010-05-20 12:24:34', 2),
(296, 'Encourages the Special Envoy of the Secretary-General for Malaria to \ncontinue raising the issue in collaboration with other United Nations organizations already working on those issues on the international political and development agendas and to work with national and global leaders to help to secure the political will, the partnerships and the funds to drastically reduce malaria deaths by 2010 through increased access to protection and treatment, especially in Africa', 2, 16, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:35', 2),
(297, 'Urges the international community, together with United Nations agencies \nand private organizations and foundations, to support the implementation of the Global Malaria Action Plan, including through support for programmes and activities at the country level in order to achieve internationally agreed targets on malaria', 6, 2, NULL, NULL, NULL, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:35', 2),
(298, 'Calls upon the international community to continue to support the \nsecretariat of the Roll Back Malaria Partnership and partner organizations, including the World Health Organization, the World Bank and the United Nations Children’s Fund, as vital complementary sources of support for the efforts of malaria-endemic countries to combat the disease', 6, 9, NULL, 267, 179, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(299, 'Appeals to the international community to work in a spirit of cooperation \ntowards effective, increased, harmonized and sustained bilateral and multilateral assistance to combat malaria, including support for the Global Fund to Fight AIDS, Tuberculosis and Malaria, in order to assist States, in particular malaria-endemic countries, to implement sound national plans, in particular health plans and sanitation plans, including malaria control strategies and integrated management of childhood illnesses, in a sustained and equitable way that, inter alia, contributes to health system development', 6, 17, NULL, 268, 180, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
