(301, 'Urges malaria-endemic countries to work towards financial sustainability, to increase, to the extent possible, domestic resource allocation to malaria control and to create favourable conditions for working with the private sector in order to improve access to good-quality malaria services', 5, 2, NULL, 270, 181, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(302, 'Urges Member States to assess and respond to the needs for integrated \nhuman resources at all levels of the health system, in order to achieve the targets of the Abuja Declaration on Roll Back Malaria in Africa and the internationally agreed development goals, including the Millennium Development Goals, to take actions, as appropriate, to effectively govern the recruitment, training and retention of skilled health personnel, and to give particular focus to the availability of skilled personnel at all levels to meet technical and operational needs as increased funding for malaria control programmes becomes available', 5, 2, NULL, 271, 206, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(303, 'Calls upon the international community, inter alia, by helping to meet the \nfinancial needs of the Global Fund to Fight AIDS, Tuberculosis and Malaria and through country-led initiatives with adequate international support, to intensify access to affordable, safe and effective antimalarial combination treatments, intermittent preventive treatment in pregnancies, adequate diagnostic facilities, long-lasting insecticide-treated mosquito nets, including, where appropriate, through the free distribution of such nets and, where appropriate, to insecticides for indoor residual spraying for malaria control, taking into account relevant international rules, including the Stockholm Convention on Persistent Organic Pollutants standards and guidelines', 6, 9, NULL, 272, 207, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(304, 'Requests relevant international organizations, in particular the World Health Organization and the United Nations Children’s Fund, to assist efforts of national Governments to provide universal access to malaria control interventions especially to address at-risk young children and pregnant women in malaria-endemic countries, particularlyin Africa, as rapidlyas possible, with due regard to ensuring proper use of those interventions, including long-lasting insecticide nets, and sustainability through full communityparticipation and implementation through the health system', 2, 3, NULL, 273, 208, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(305, 'Calls upon Member States, in particular malaria-endemic countries, with \nthe support of the international community, to establish and/or strengthen national policies and operational plans, with a view to scaling up efforts to achieve internationally agreed malaria targets for 2010 and 2015, in accordance with the technical recommendations of the World Health Organization', 5, 9, NULL, 274, 205, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2),
(306, 'Encourages all African countries that have not yet done so to implement \nthe recommendations of the Abuja Summit in 2000 to reduce or waive taxes and tariffs for nets and other products needed for malaria control, both to reduce the price of the products to consumers and to stimulate free trade in those products', 7, 16, NULL, 275, 182, 'draft', '2010-05-20 12:24:35', '2010-05-20 12:24:42', 2);
