(308, 'Expresses its concern about the increase in resistant strains of malaria in \nseveral regions of the world, and calls upon Member States, with support from the World Health Organization and other partners, to strengthen surveillance systems for drug and insecticide resistance and upon the World Health Organization to coordinate a global network for the monitoring of drug and insecticide resistance and to ensure that drug and insecticide testing is fully operational in order to enhance the use of current insecticide-and artemisinin-based combination therapies', 5, 9, NULL, 278, 226, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(309, 'Urges all Member States experiencing resistance to conventional \nmonotherapies to replace them with combination therapies, as recommended by the World Health Organization, and to develop the necessary financial, legislative and regulatory mechanisms in order to introduce artemisinin combination therapies at affordable prices and to prohibit the marketing of oral artemisinin monotherapies, in a timely manner', 5, 2, NULL, 279, 184, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(310, 'Recognizes the importance of the development of safe and cost-effective \nvaccines and new medicines to prevent and treat malaria and the need for further and accelerated research, including into safe, effective and high-quality traditional therapies, using rigorous standards, including by providing support to the Special Programme for Research and Training in Tropical Diseases and through effective global partnerships, such as the various malaria vaccine initiatives and the Medicines for Malaria Venture, \nwhere necessary stimulated by new incentives to secure their development and through effective and timely support towards pre-qualification of new antimalarials and their combinations', 4, 22, NULL, 280, 184, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(311, 'Calls upon the international community, including through existing \npartnerships, to increase investment in and efforts towards the research and development of new, safe and affordable malaria-related medicines, products and technologies, such as vaccines, rapid diagnostic tests, insecticides and delivery modes, to prevent and treat malaria, especially for at-risk children and pregnant women, in order to enhance effectiveness anddelaythe onset of resistance', 6, 9, NULL, 281, 197, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(312, 'Calls upon malaria-endemic countries to assure favourable conditions for \nresearch institutions, including allocation of adequate resources and development of national policies and legal frameworks, where appropriate, with a view to, inter alia, informing policyformulation and strategic interventions on malaria', 5, 9, NULL, 282, 282, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(313, 'Reaffirms the right to use, to the fullest extent, the provisions contained \nin the World Trade Organization Agreement on Trade-Related Aspects of \nIntellectual Property Rights (TRIPS Agreement), the Doha Declaration on the TRIPS Agreement and Public Health,  the decision of the World Trade \nOrganization’s General Council of 30 August 2003 and amendments to article 31 of the Agreement, which provide flexibilities for the protection of public health, and in particular to promote access to medicines for all, including the production, under compulsory licensing, of generic drugs in the prevention and treatment of malaria, and resolves to assist developing countries in this regard', 6, 4, NULL, 283, 230, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(314, 'Calls upon the international community to support ways to expand access \nto and the affordability of key products, such as vector control measures, including indoor residual spraying, long-lasting insecticide-treated nets and artemisinin-based combination therapy for populations at risk of exposure to resistant strains of falciparum malaria in malaria-endemic countries, particularly in Africa, including through additional funds and innovative mechanisms, inter alia, for the financing and scaling up of artemisinin production and procurement, as appropriate, to meet the increased need', 6, 9, NULL, 284, 232, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:42', 2),
(315, 'Encourages the producers of long-lasting insecticide-treated nets to accelerate technology transfer to developing countries and invites the World Bank and regional development funds to consider supporting malaria-endemic countries in establishing factories to scale up production of long-lasting insecticide-treated nets', 8, 16, NULL, 285, 233, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:43', 2),
(316, 'Calls upon the international community and malaria-endemic countries, \nin accordance with existing guidelines and recommendations of the World Health Organization and the requirements of the Stockholm Convention, to increase capacity for the safe, effective and judicious use of indoor residual spraying and other forms of vector control and for quality control measures to ensure conformity with international rules, standards and guidelines', 6, 9, NULL, 286, 234, 'draft', '2010-05-20 12:24:36', '2010-05-20 12:24:43', 2),
(317, 'Urges the international community to become fully knowledgeable about \nWorld Health Organization technical policies and strategies and the provisions in the Stockholm Convention related to the use of DDT, including for indoor residual spraying, long-lasting insecticide-treated nets and case management, intermittent preventive treatment for pregnant women and monitoring of in vivo resistance studies to artemisinin-based combination therapy treatment, so that projects support those policies, strategies and provisions', 6, 2, NULL, 287, 235, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(318, 'Requests the World Health Organization, the United Nations Children’s \nFund and donor agencies to provide support to those countries which choose to use DDT for indoor residual spraying so as to ensure that it is implemented in accordance with international rules, standards and guidelines, and to provide all possible support to malaria-endemic countries to manage the intervention effectively and prevent the contamination, in particular, of agricultural products with DDT and other insecticides used for indoor residual spraying', 2, 3, NULL, 288, 236, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(319, 'Encourages the World Health Organization and its member States, with \nthe support of the parties to the Stockholm Convention, to continue to explore possible alternatives to DDT as a vector control agent', 7, 16, NULL, 289, 261, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(320, 'Calls upon malaria-endemic countries to encourage regional and \nintersectoral collaboration, both public and private, at all levels, especially in education, health, agriculture, economic development and the environment, to advance malaria control objectives', 6, 9, NULL, 290, 214, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(321, 'Calls upon the international community to support the strengthening of \nhealth systems and national pharmaceutical policies, to monitor and fight against the trade in counterfeit antimalarial medicines and prevent their distribution and use, and to support coordinated efforts, inter alia, by providing technical assistance to improve surveillance, monitoring andevaluation systems and their alignment with national plans and systems so as to better track and report changes in coverage, the need for scaling up recommended interventions and the subsequent reductions in the burden of malaria', 6, 9, NULL, 291, 238, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(322, 'Urges Member States, the international community and all relevant \nactors, including the private sector, to promote the coordinated implementation and enhance the quality of malaria-related activities, including via the Roll Back Malaria Partnership, in accordance with national policies and operational plans that are consistent with the technical recommendations of the World Health Organization and recent efforts and initiatives, including, where appropriate, the Paris Declaration on Aid Effectiveness and the Accra Agenda for Action, adopted during the Third High-level Forum on Aid Effectiveness, held in Accra from 2 to 4 September 2008', 5, 2, NULL, 292, 216, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2),
(323, 'Notes that the 2010 High-level Plenary Meeting of the sixty-fifth session of the General Assembly will provide an opportunity to review progress in  achieving the Millennium Development Goals requests the Secretary-General, in close collaboration with the Director-General of the World Health Organization and in consultation with Member States, to submit to the Assembly at its sixty-fifth session a report on progress towards achieving the internationallyagreed targets for 2010 and an evaluation of the implementation of the first Decade to Roll Back Malaria in Developing Countries, Particularlyin Africa, including recommendations for further actions', 2, 3, NULL, 293, 169, 'draft', '2010-05-20 12:24:37', '2010-05-20 12:24:43', 2);
